Boy, it felt amazing to be back at the races and back at @ironmanmx!

Life at Digging Deep [and life in general] has been so busy, along with the unexpected May snow here in Wisconsin, that I hadn't ridden my quad since last August. But honestly, all things considered, I felt pretty damn good right away on Friday. Destroyed a bearing carrier in Moto 1 and took out most of the rest of my rear end, but still managed to nurse it home for a second-place finish and ultimately second overall with 2-2 scores in the 25+ class. I said it last year and I'll say it again now, I have no shame losing to @musick209 — he's a bad dude, especially when in midseason form. We were racing each other for Pro Rookie of the Year honors a decade ago, so it's pretty special to be lining up with one another still today. That being said, I hope to get a few more laps under my belt and maybe we can have a little fun together down the stretch. Maybe we'll sign up for another class at Sunset Ridge as well.

Thanks to all my supporters, my loved ones for staying on the ride with me, and I'm humbled by the overwhelming support the @diggingdeepatvmxpodcast receives at these events — it truly feels surreal! Next up: our favorite event of the year 🤘

