It has been a challenging week for our family. We didn't know if we were going to make it, but Brooke and I managed to make it to Sunset Ridge for the ATV National at the eleventh hour.

Amidst the chaos, piloting my YFZ450R is where I felt most like myself. Friday practice went well, and I was looking forward to doing some racing over the weekend, but the universe had other plans. On Saturday morning, my machine developed some engine noise. While definitely disappointed, it didn't make sense to push it further and risk further damaging my machine. So, instead, we stayed to cover the event for the @diggingdeepatvmxpodcast before heading home.

Everyone and everything is going to be okay — we'll rebuild, recover, and be better for it. Looking forward to the rest of the season and some great opportunities ahead. See you at the races! 🤘

