What a week at The Ranch! Following my dad's stroke, I really wanted to win one of these things for him — so I'm stoked to bring him home some hardware.

It's been a crazy summer, but with the help of @38_motorsports I got my YFZ450R back up and running just in time for Loretta's. Brooke and I traveled to Tennessee on next to no riding time and came home with a 25+ Loretta Lynn's title.

I'm humbled by how many of you sought me out this weekend to share kind words and support for the @diggingdeepatvmxpodcast and myself, for that I am so grateful. Thanks to all my supporters and my loved ones for continuing on the ride with me.

This surely is a dream 🩵🤟 

